import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div>
      <nav>
        <li>Home</li>
        <li>About</li>
        <li>Contact</li>
        <li>Service</li>
      </nav>
    </div>
  );
}

export default App;
